import styled from "styled-components";
import { useSelector } from "react-redux";

import { useParams } from "react-router";

import { ComponentHeaderAuth } from "@components";
import { selectAuth, selectMerchant } from "@redux";
import { ModuleResetPassword } from "@modules";
import { PageUserDetail } from "@pages";

export const PageResetPassword = () => {
    //page hook
    const { resetPasswordId } = useParams<{ resetPasswordId: string }>();
    //redux page
    const merchant = useSelector(selectMerchant);
    const { detailUser } = useSelector(selectAuth);
    //page variable
    const href = window.location.href;
    const url = new URL(href);
    const email = url.searchParams.get("email");

    return (
        <>
            {!detailUser ? (
                <>
                    <ComponentHeaderAuth />
                    <ModuleResetPassword
                        email={email || ""}
                        resetPasswordId={resetPasswordId || ""}
                    />
                </>
            ) : (
                <PageUserDetail />
            )}
        </>
    );
};
